import Link from 'next/link'

const pids = ['id1', 'id2', 'id3']

console.log(pids);

export default function test () {
  return (
    <>
      {
        pids.map(pid => (
          <Link href="/posts/[pid]" as={`/posts/${pid}`}>
            <a>Post {pid} <br/></a>
          </Link>
        ))
      }
    </>
  )
}
